import React from 'react';
import Card from './Card';
import './Card.css';

const materias = [
  { titulo: "Português", conteudo: "Conteúdo de Português" },
  { titulo: "Matemática", conteudo: "Conteúdo de Matemática" },
  { titulo: "História", conteudo: "Conteúdo de História" },
  { titulo: "Geografia", conteudo: "Conteúdo de Geografia" },
  { titulo: "Sociologia", conteudo: "Conteúdo de Sociologia" }
];

function App() {
  return (
    <div style={{ padding: '20px' }}>
      {materias.map(materia => (
        <Card title={materia.titulo} content={materia.conteudo} />
      ))}
    </div>
  );
}

export default App;
